import React from "react";
import Header from "./moduls/Header";
import MainPage from "./moduls/MainPage";
import About from "./moduls/About";
import Footer from "./moduls/Footer";
import "./css/main.css";

class App extends React.Component {
  render() {
    return (
      <div>
        <Header />
        {this.selectPage()}
        <Footer />
      </div>
    );
  }
  selectPage() {
    const currentUrl = window.location.pathname;
    const pages = [MainPage, About];
    pages.forEach((el) => {
      console.log(el.url);
      if (el.url === currentUrl) {
        console.log(currentUrl);
        return <el />;
      }
    });
    return <MainPage />;
  }
}

export default App;
